import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './FindPasswordPage.scss';

const API_URL = process.env.REACT_APP_API_URL || 'http://localhost:8080';

const FindPasswordPage: React.FC = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    email: '',
    username: '',
    newPassword: '',
    confirmPassword: '',
  });
  const [loading, setLoading] = useState(false);
  const [result, setResult] = useState<{ success: boolean; message: string } | null>(null);

  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();

    if (!formData.email.trim() || !formData.username.trim() || !formData.newPassword.trim() || !formData.confirmPassword.trim()) {
      alert('모든 항목을 입력해주세요.');
      return;
    }

    if (formData.newPassword !== formData.confirmPassword) {
      alert('비밀번호가 일치하지 않습니다.');
      return;
    }

    if (formData.newPassword.length < 6) {
      alert('비밀번호는 6자 이상이어야 합니다.');
      return;
    }

    setLoading(true);
    setResult(null);

    try {
      const response = await fetch(`${API_URL}/api/auth/reset-password`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        credentials: 'include',
        body: JSON.stringify({
          email: formData.email,
          username: formData.username,
          newPassword: formData.newPassword,
        }),
      });

      const data = await response.json();
      setResult(data);

      if (data.success) {
        setFormData({
          email: '',
          username: '',
          newPassword: '',
          confirmPassword: '',
        });
      }

    } catch (err) {
      console.error('비밀번호 재설정 오류:', err);
      setResult({
        success: false,
        message: '비밀번호 재설정 중 오류가 발생했습니다.',
      });
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="find-password-page">
      <div className="find-password-container">
        <h1>비밀번호 찾기</h1>
        <p className="description">이메일과 아이디를 입력하고 새 비밀번호를 설정하세요.</p>

        {!result && (
          <form onSubmit={handleSubmit}>
            <div className="form-group">
              <label>이메일</label>
              <input
                type="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                placeholder="example@email.com"
                disabled={loading}
              />
            </div>

            <div className="form-group">
              <label>아이디</label>
              <input
                type="text"
                name="username"
                value={formData.username}
                onChange={handleChange}
                placeholder="아이디를 입력하세요"
                disabled={loading}
              />
            </div>

            <div className="form-group">
              <label>새 비밀번호</label>
              <input
                type="password"
                name="newPassword"
                value={formData.newPassword}
                onChange={handleChange}
                placeholder="6자 이상 입력하세요"
                disabled={loading}
              />
            </div>

            <div className="form-group">
              <label>비밀번호 확인</label>
              <input
                type="password"
                name="confirmPassword"
                value={formData.confirmPassword}
                onChange={handleChange}
                placeholder="비밀번호를 다시 입력하세요"
                disabled={loading}
              />
            </div>

            <button type="submit" className="submit-button" disabled={loading}>
              {loading ? '처리 중...' : '비밀번호 변경'}
            </button>
          </form>
        )}

        {result && (
          <div className={`result ${result.success ? 'success' : 'error'}`}>
            <div className="result-icon">
              {result.success ? '✓' : '✗'}
            </div>
            <p className="result-message">{result.message}</p>
            <div className="result-buttons">
              {result.success ? (
                <button onClick={() => navigate('/login')} className="login-button">
                  로그인하기
                </button>
              ) : (
                <button onClick={() => setResult(null)} className="retry-button">
                  다시 시도
                </button>
              )}
            </div>
          </div>
        )}

        <div className="links">
          <button onClick={() => navigate('/login')}>로그인</button>
          <span>|</span>
          <button onClick={() => navigate('/find-username')}>아이디 찾기</button>
          <span>|</span>
          <button onClick={() => navigate('/register')}>회원가입</button>
        </div>
      </div>
    </div>
  );
};

export default FindPasswordPage;
